import React from 'react';
import './Homenav.css';
import {Link} from "react-router-dom";
const Homenav = () => {
    return(
        <div>
            <nav className="navbar">
            <div className="logo">
                <Link to="/">
                    <img src="path/to/logo.png" alt="Logo" />
                </Link>
            </div>
            <div className="nav-links">
                <Link to="/">Home</Link>
                <Link to="/">Pricing</Link>
                <Link to="/">About</Link>
                <Link to="/">Profile</Link>
            </div>
        </nav>
        </div>
    )
}
export default Homenav
